/**
 * Isomorphic library exports from isomorphic.js.
 *
 * @module isomorphic
 */

// @ts-ignore
import iso from 'isomorphic.js'

export const performance = /** @type {any} */ (iso.performance)
export const cryptoRandomBuffer = /** @type {any} */ (iso.cryptoRandomBuffer)
